const raw = $input.all().map(i => i.json);

// --- FILTRAR ITENS QUE N√ÉO SERVEM ---
const data = raw.filter(i => i.kind !== "drive#permission");

// Agora data fica assim:
// 0 ‚Üí placeholders
// 1 ‚Üí indexes
// 2 ‚Üí documentId + occurrencesChanged
// 3+ ‚Üí fotos

const placeholders = data[0];     // { placeholder, placeholder1, placeholder2 }
const indexes = data[1];          // { Index, index1, Index2 }
const docInfo = data[2];          // { documentId }
const fotos = data.slice(3);      // [{id,name}, {id,name}...]

// --- Normaliza nomes dos indexes (Index ‚Üí index) ---
const normalizedIndexes = {};
Object.keys(indexes).forEach(k => {
  normalizedIndexes[k.toLowerCase()] = indexes[k];
});

// --- Montar sa√≠da final ---
const result = Object.keys(placeholders).map((key, i) => {
  const placeholderValue = placeholders[key];

  // placeholder ‚Üí index / placeholder1 ‚Üí index1
  const indexKey = key.replace("placeholder", "index").toLowerCase();
  const indexValue = normalizedIndexes[indexKey] ?? null;

  const foto = fotos[i] || {};

  return {
    json: {
      placeholder: placeholderValue,
      index: indexValue,
      documentId: docInfo.documentId,
      id: foto.id || null,
      name: foto.name || null
    }
  };
});

return result;
